namespace positionRecord
{
	static int index = 0;
	const static int positionNumber = 8;
	static XYPosition position[positionNumber];
	static void refresh()
	{
		index++;
		if (index > positionNumber - 1)
		{
			index = 0;
		}
		position[index] = info.self.xy_pos;
	}
	XYPosition getPosition(int n)
	{
		int temp = index + n;
		while (temp < 0)
		{
			temp += 8;
		}
		while (temp > 7)
		{
			temp -= 8;
		}
		return position[temp];
	}
	void print()
	{
		fileOut << endl << "\tpositionRecord :" << endl;
		for (int i = 0; i > -positionNumber; i--)
		{
			fileOut << "\t\tposition " << i << " : " << getPosition(i).x << "   " << getPosition(i).y << endl;
		}

	}
}


