inline void refreshMoveAngle()
{
	if (abs(positionRecord::getPosition(0).y - positionRecord::getPosition(-1).y) + abs(positionRecord::getPosition(0).x - positionRecord::getPosition(-1).x) < SMALL)
		return;
	else
	{
		info_self_move_angle = 180 * INVPI*atan2((positionRecord::getPosition(0).y - positionRecord::getPosition(-1).y), (positionRecord::getPosition(0).x - positionRecord::getPosition(-1).x));
		while (info_self_move_angle < 0)
			info_self_move_angle += 360;
		while (info_self_move_angle >= 360)
			info_self_move_angle -= 360;
	}
}

//ÒÆ¶¯Ïà¹Ø
void AI_move(double moveAngle, double viewAngle)
{
	//f << "\tlast positon\t" << position[0].x << "\t " << position[0].y << std::endl;
	//std::cout << "\tmove: " << moveAngle << "\tview: " << viewAngle << std::endl;
	fileOut << "\tmove: " << moveAngle << "\tview: " << viewAngle << std::endl;
	while (moveAngle < 0)
	{
		moveAngle += 360;
	}
	while (viewAngle < 0)
	{
		viewAngle += 360;
	}
	while (moveAngle > 360)
	{
		moveAngle -= 360;
	}
	while (viewAngle > 360)
	{
		viewAngle -= 360;
	}
	move(moveAngle, viewAngle);


	info_self_move_angle += moveAngle;
	while (info_self_move_angle >= 360)
	{
		info_self_move_angle -= 360;
	}
	while (info_self_move_angle < 0)
	{
		info_self_move_angle += 360;
	}

}



