XYPosition getXYPosition(PolarPosition polarPos)
{
	XYPosition xyPos;
	xyPos.x = info.self.xy_pos.x + polarPos.distance*cos((info.self.view_angle + polarPos.angle) / 180 * PI);
	xyPos.y = info.self.xy_pos.y + polarPos.distance*sin((info.self.view_angle + polarPos.angle) / 180 * PI);
	return xyPos;
}


//µ±Ëü·µ»ØµÄÖµ²»Îª0Ê±£¬Ö¤Ã÷»¹±»¿¨×¡£¬´Ëº¯Êý»á½øÐÐÒ»ÏµÁÐÒÆ¶¯²Ù×÷£¬ÇëÁ¢¼´½áÊøplay_game()£¬ÒÔÃâºóÃæµÄÒÆ¶¯¸²¸ÇÆä²Ù×÷¡£
//µ±·µ»ØµÄÖµÎª0Ê±£¬Ö¤Ã÷Ã»ÓÐ±»¿¨×¡£¬¼ÌÐøÖ´ÐÐÆäËû²Ù×÷¡£
int checkStuck(int n)
{
	static int stuckLevel = 0;
	const int MAXSTUCKLEVEL = 6;
	static int lastPickTimes = 0;

	if (Calc_Distance(positionRecord::getPosition(0), positionRecord::getPosition(-2)) < SMALL && Calc_Distance(positionRecord::getPosition(-1), positionRecord::getPosition(-3)) < SMALL)
	{
		fileOut << endl << "\tFake Stuck !!!" << endl;
	}

	if (abs(positionRecord::getPosition(0).x - positionRecord::getPosition(-1).x) + abs(positionRecord::getPosition(0).y - positionRecord::getPosition(-1).y) < SMALL && (lastPickTimes == pickTimes))
	{
		stuckLevel += 2;
		if (stuckLevel > MAXSTUCKLEVEL)
			stuckLevel = MAXSTUCKLEVEL;

		int x = (int)info.self.xy_pos.x;
		int y = (int)info.self.xy_pos.y;
		bool available[8] = { 0,0,0,0,0,0,0,0 };//availableÎª0Ê±±íÊ¾²»ÄÜÍ¨ÐÐ¡£
		available[0] = !(boolMap[x + 1][y - 1] || boolMap[x + 1][y] || boolMap[x + 1][y + 1]);
		available[1] = !(boolMap[x + 1][y] || boolMap[x + 1][y + 1] || boolMap[x][y + 1]);
		available[2] = !(boolMap[x + 1][y + 1] || boolMap[x][y + 1] || boolMap[x - 1][y + 1]);
		available[3] = !(boolMap[x - 1][y + 1] || boolMap[x - 1][y] || boolMap[x][y + 1]);
		available[4] = !(boolMap[x - 1][y + 1] || boolMap[x - 1][y] || boolMap[x - 1][y - 1]);
		available[5] = !(boolMap[x - 1][y - 1] || boolMap[x - 1][y] || boolMap[x][y - 1]);
		available[6] = !(boolMap[x - 1][y - 1] || boolMap[x][y - 1] || boolMap[x + 1][y - 1]);
		available[7] = !(boolMap[x][y - 1] || boolMap[x + 1][y - 1] || boolMap[x + 1][y]);
		//¼ÙÉèavailable²»»áÈ«Îª0
		bool allAvailable = 0;
		for (int i = 0; i < 8; i++)
			allAvailable |= available[i];
		if (allAvailable == 0)
		{
			AI_move(-45, -45);
			fileOut << endl << "\tALL DIRECTION UNAVAILABLE !" << endl;
			fileOut << endl << "\tStuck level : " << stuckLevel << endl << endl;
			return stuckLevel;
		}
		double tempAngle = info_self_move_angle - (-22.5);
		while (tempAngle < 0)
			tempAngle += 360;
		while (tempAngle >= 360)
			tempAngle -= 360;
		int targetType = (double)tempAngle / (double)45;
		int dir = targetType;//!!!
		int i = dir; int j = dir;
		for (;;)
		{
			i--;
			j++;
			if (i < 0)
				i = 7;
			if (j > 7)
				j = 0;
			if (available[i])
			{
				dir = i;
				break;
			}
			if (available[j])
			{
				dir = j;
				break;
			}
		}
		double targetAngle;
		switch (dir)
		{
		case 0: targetAngle = 0 - info.self.view_angle; break;
		case 1:	targetAngle = 45 - info.self.view_angle; break;
		case 2:	targetAngle = 90 - info.self.view_angle; break;
		case 3:	targetAngle = 135 - info.self.view_angle; break;
		case 4:	targetAngle = 180 - info.self.view_angle; break;
		case 5:	targetAngle = -135 - info.self.view_angle; break;
		case 6:	targetAngle = -90 - info.self.view_angle; break;
		case 7:	targetAngle = -45 - info.self.view_angle; break;
		default:targetAngle = PoisonRelatedPosition.angle;
		}
		while (targetAngle > 180)
			targetAngle -= 360;
		while (targetAngle < -180)
			targetAngle += 360;
		AI_move(targetAngle, targetAngle);

	}
	else
	{
		lastPickTimes = pickTimes;
		stuckLevel --;
		if (stuckLevel <= 0)
			stuckLevel = 0;
		if (stuckLevel > 0)
		{
			AI_move(0, 0);
		}
	}
	fileOut << endl << "\tStuck level : " << stuckLevel << endl << endl;
	return stuckLevel;
}




